import React, { useState, useEffect } from 'react';
import {
  Row,
  Col,
  Collapse, Button,
  Modal, ModalHeader, ModalBody, ModalFooter
} from 'reactstrap';
import Banner from '../bannerComponent/banner/BannerComponent'
import Item from '../pageComponents/item/ItemComponent.js'
import ItemBest from '../pageComponents/itembest/ItemBest.js'
import JourneyComponent from '../pageComponents/journey/JourneyComponent.js'
import MissionComponent from '../pageComponents/mission/MissionComponent.js'
import FooterComponent from '../footerComponent/footer/FooterComponent'
import axios from "axios";
import 'bootstrap/dist/css/bootstrap.min.css';

const HomeScreen = () => {
  const[listItemFashion,setListItem] = useState([]); 
  const[replaceListItem, setReplace] = useState([]);

    useEffect(() => {
        axios.get("/bag").then(res => {
            setListItem(res.data);
        }).catch(err => console.log(err))
    },[listItemFashion.length])

    useEffect(() => {
      axios.get("/card/").then(res => {
        setReplace(res.data);
      }).catch(err => console.log(err))
    },[replaceListItem.length])


  return(
    <Row className="m-0">
        <div>
          {/* <Banner /> */}
          <Item list={{
            numberList:1,
            listItem: listItemFashion,
            category:"Bags/Briefcases",
            nextCategory:"Card Wallet",
            replaceListItem: replaceListItem
            }}/>
          <ItemBest />
          <Item list={{
            numberList:3,
            listItem: listItemFashion,
            category:"Bags/Briefcases",
            nextCategory:"Card Wallet",
            replaceListItem: replaceListItem
            }}/>
          <Item list={{
            numberList:5,
            listItem: listItemFashion,
            category:"Bags/Briefcases",
            nextCategory:"Card Wallet",
            replaceListItem: replaceListItem
            }}/>
          <JourneyComponent />
          <Item list={{
            numberList:7,
            listItem: listItemFashion,
            category:"Bags/Briefcases",
            nextCategory:"Card Wallet",
            replaceListItem: replaceListItem
            }}/>
          <MissionComponent />
          <Item list={{
            numberList:9,
            listItem: listItemFashion,
            category:"Bags/Briefcases",
            nextCategory:"Card Wallet",
            replaceListItem: replaceListItem
            }}/>
          <FooterComponent />
        </div>
  </Row>
  );
}
export default HomeScreen;
